import './Header.scss';

function Header() {
  return (
    <header>
      <img src="" alt="BrainFlix Logo" />
      <div> 
        <form class="search">
          <input class="search__input" type="text" name="search" onFocus="this.value=''" value="search" />
          <img src="" alt="BrainFlix Logo" />
          <input class="search__submit" type="submit" name="submit" value="UPLOAD" />
        </form>
      </div>
    </header>
  )
}

export default Header;
